import Title from './Title';

export default function Landing() {
  const theme = useTheme();

  return (

    <div>
         <Typography component="h1" variant="h3" color="inherit" noWrap><strong>
            Getting Started
          </strong></Typography>

		  <Typography component="h2" variant="h7" color="inherit" noWrap>
            Getting Started
          </Typography>

    </div>

  );
}
